import { Link } from "react-router-dom";

export default function Home() {
  return (
    <>
      {/* BACKGROUND GRADIENT COLOR */}
      <div className="flex items-center justify-center min-h-screen bg-gradient-to-r from-[#ff6b6b] to-[#1eae98]">
        {/* CARD CONTAINER */}
        <div className="bg-white p-6 md:p-12 rounded-lg shadow-md w-full md:max-w-4xl">
          {/* JUDUL */}
          <h1 className="text-2xl md:text-4xl font-bebas mb-4 text-center">
            SELAMAT DATANG DI APLIKASI SISTEM PAKAR KLASIFIKASI DIABETES
          </h1>
          {/* PENJELASAN SINGKAT APLIKASI */}
          <p className="font-poppins text-sm  text-center leading-8">
            Aplikasi ini adalah sebuah aplikasi yang digunakan sebagai opini
            kedua dari dokter mengenai diagnosa pasien penderita diabetes ke
            kategori Diabetes Mellitus 1 atau Diabetes Mellitus 2. Aplikasi ini
            adalah sebagai bukti penyelesaian Tugas Akhir Benedicto Reinaldy
            dalam studinya di Strata 1 Ilmu Informatika Universitas Katolik
            Darma Cendika Surabaya.
          </p>
          {/* BUTTONS */}
          <div className="font-poppins text-lg justify-center flex mt-5">
            {/* BUTTON TO ABOUT APP */}
            <Link to={"/about-app"}>
              <button className="btn btn-active btn-secondary mr-3">
                TENTANG APP
              </button>
            </Link>
            {/* BUTTON TO LIST PERTANYAAN */}
            <Link to="/list-pertanyaan">
              <button className="btn btn-active btn-primary">MULAI</button>
            </Link>
          </div>
        </div>
      </div>
    </>
  );
}
